import React from 'react'
import Image from './Components/Images/out.jpg'
import Logo from './Components/Images/Logo1.png'

const LeftDiv = () => {
    return (
        <div className='w-1/2 h-screen bg-cover bg-center align-middle p-5'
        style={{
        backgroundImage: `url(${Image})`,}}>
            <div className='p-5 w-1/4 flex gap-2 relative align-middle'>
                <img src={Logo} className='w-10'/>
                <p className='text-2xl relative font-bold text-white'>Urbanlink</p>
            </div>
            <div className='flex items-center justify-center bg-white w-2/5 h'>
            <div className='text-center mx-auto'>
                <h3 className='text-3xl inline-block'>Connect.</h3>
                <h3 className='inline-block'>Collaborate.</h3>
                <h3 className='inline-block'>Work Efficiently.</h3>
            </div>
</div>

        </div>
    );
};

const RightDiv = () => {
    return(
        <p>Home2</p>
    )
}
export default function App() {
    return (
        <div className='flex align-middle'>
            <LeftDiv/>
            <RightDiv/>

        </div>
    )
}
